import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu.svg'

function NavbarHamburger() {
    return (
        <span class="navbar-child">
            <button id="hamburger">
                Menu
            </button>
        </span>
    )
}

function NavbarTitle() {
    return (
        <span class="navbar-child">
            Museum
        </span>
    )
}

function Navbar() {
    return (
        <div class="navbar-main">
            <NavbarHamburger />
            <NavbarTitle />
        </div>
    )
}

function Page() {
    return (
        <Navbar />
    )
}

ReactDOM.render(
    <Page />,
    document.getElementById('root')
);
